import CenterBox from "../layout/CenterBox";
import Header from "../components/Header";
import chatRoomStyle from "../assets/Styles/Chatroom.module.scss";

export default function ChatRoom() {
  return (
    <CenterBox>
      <div className={chatRoomStyle.chatRoomDiv}>
        <Header />
      </div>
    </CenterBox>
  );
}
